theo_power=function(m,sd,n,alpha=.05){
  
  k=length(m)
  sd_pooled<-sqrt(sum((n-1)*sd^2)/(sum(n)-k)) #pooled standard deviation
  sd_BF<-sqrt(sum((1-n/sum(n))*sd^2)) #sd of B-F
  mu <- sum(n*m)/sum(n)
  mean_SS <- sum(n*(m-mu)^2)
  mean_sd <- sqrt(sum(n*(m-mu)^2)/sum(n))
  f <- mean_sd/sd_pooled
  
  #Power for ANOVA
  df1 <- k - 1 
  df2_anova <- sum(n) - k
  crit_f <- qf(1 - alpha, df1, df2_anova)
  ncp_anova <- mean_SS/(sd_pooled^2) #ncp_anova <- f^2 * sum(n)
  power_anova <- pf(crit_f, df1, df2_anova, ncp = ncp_anova, lower.tail = FALSE)
  
  #Power for Welch's ANOVA
  df1 <- k - 1 
  w_j <- n/sd^2 
  mu <- sum((w_j*m)/sum(w_j))
  df2_welch <- (k^2-1)/(3*sum((1-w_j/sum(w_j))^2/(n-1)))
  crit_w <- qf(1 - alpha, df1, df2_welch)
  ncp_w <- sum(w_j*(m-mu)^2)
  power_ANOVAwelch <- pf(crit_w, df1, df2_welch, ncp = ncp_w, lower.tail = FALSE)
  
  #Power for Brown-Forsythe's test of comparison of means
  df1 <- k - 1 
  df2_BF <- 1/sum((((1-n/sum(n))*sd^2)/sum((1-n/sum(n))*sd^2))^2/(n-1))
  crit_BF <- qf(1 - alpha, df1, df2_BF)
  ncp_BF <- mean_SS/(sd_BF^2)*(k-1) 
  power_BF <- pf(crit_BF, df1, df2_BF, ncp = ncp_BF, lower.tail = FALSE)
  
  return(c(power_anova,power_ANOVAwelch,power_BF))
  
}




res=function(dist,var=list(),alpha){
  
  results<-data.frame(matrix(0,80,3,dimnames=list(1:80,c("F-test","Welch","B-F"))))
  
  for (s in 1:80){
    results[s,] = SigProportion(var[[s]],alpha)
  }
  setwd(dir="C:/Users/Marie/Documents/Github_projects/W-ANOVA") # replace "???" by the desired destination file
  write.table(results,paste0("power for ",dist," distribution with k=",k," and base n =",n1,".txt"),sep=";",dec=",")
}




power <- function(var=list(),dist,k,n1){
  power_results<-data.frame(matrix(0,16,3,dimnames=list(1:16,c("F-test","Welch","B-F"))))
  
  for (s in 1:16){
    power_results[s,1] = sum(var[[s]][,1]<.05)/length(var[[s]][,1])
    power_results[s,2] = sum(var[[s]][,2]<.05)/length(var[[s]][,2])
    power_results[s,3] = sum(var[[s]][,3]<.05)/length(var[[s]][,3])
  }
  
  setwd(dir="C:/Users/Marie/Documents/Github_projects/W-ANOVA") # replace "???" by the desired destination file
  
  write.table(power_results,str_c("power for ",dist," distribution with k=",k," and base n =",n1,".txt"),sep=";",dec=",")
}


